import { ResponsiveContainer } from 'recharts'

const data = {
    labels: [
      'Red',
      'Blue',
      'Yellow'
    ],
    datasets: [{
      label: 'My First Dataset',
      data: [300, 50, 100],
      backgroundColor: [
        'rgb(255, 99, 132)',
        'rgb(54, 162, 235)',
        'rgb(255, 205, 86)'
      ],
      hoverOffset: 4
    }]
  };

const Time = () => {

    return (
        <div style={{ marginTop: '4rem' }}>
            <h1>Line Chart</h1>
        </div>
    );
};

export default Time
